import React from "react";
import { useHistory } from "react-router-dom"; // Import useHistory for navigation
import "./NotFoundPage.css"; // Import the CSS file

function NotFoundPage() {
  const history = useHistory(); // Initialize useHistory hook

  const handleGoHome = () => {
    history.push("/"); // Navigate to the homepage
  };

  return (
    <div className="not-found-page">
      <img src={require('../images/404.png').default} alt="Not Found" />
      <h1>אופס! העמוד אינו נמצא!</h1>
      <p>The page you are looking for does not exist.</p>
      <button className="back-button" onClick={handleGoHome}>
        נסו לחזור בחזרה
      </button>
    </div>
  );
}

export default NotFoundPage;
